INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3770010226000', 'Mochi \'z', 'Mochi mangue : Eau, sucre, sirop de glucose, purée de mangue (mangue (11.6%), sucre), farine de riz, purée de fruit de la passion (fruit de la passion (7.5%), sucre), amidon de riz, amidon de maïs, _beurre_, sucre inverti, paprika en poudre, épaississants : gomme de xanthane, pectine, gomme de guar, protéines de pois.   Mochi framboise litchi : Eau, sucre, sirop de glucose, _lait_ (12.7%), purée de framboise (framboise (10.3%), sucre), farine de riz, amidon de riz, _lait_ écrémé en poudre (2.7%), _beurre_, amidon de maïs, purée de litchi (litchi (0.8%), sucre), émulsifiant : mono et diglycérides d\'acide gras, épaississants : farine de caroube, gomme de guar, gélifiants : alginate de sodium, carraghénanes, colorant : rouge de betterave, arôme naturel de litchi.   Mochi chocolat : _lait_ (22.5%), eau, sucre, sirop de glucose, farine de riz, amidon de riz, _beurre_, chocolat en poudre 64% de cacao (pâte de cacao, sucre, cacao maigre en poudre) (2.8%), _lait_ écrémé en poudre (1.6%), sucre inverti, amidon de maïs, dextrose, émulsifiant : mono et diglycérides d\'acide gras, épaississants : farine de caroube, gomme de guar, gélifiants : alginate de sodium, carraghénanes.  Mochi vanille : _lait_ (23%), eau, sucre, sirop de glucose, farine de riz, amidon de riz, _beurre, _lait_ écrémé en poudre (1.7%), _crème_ (1.5%), amidon de maïs, arôme naturel de vanille (0.57%), extrait de vanille Bourbon (0.4%), émulsifiant : mono et diglycérides d\'acide gras, épaississants : farine de caroube, gomme de guar, gélifiants : alginate de sodium, carraghénanes, grains noirs de vanille épuisée, colorant : bêta carotène.', 'https://static.openfoodfacts.org/images/products/377/001/022/6000/front_fr.4.400.jpg', '2.9', '2', '45', '28.3', '', '1.5', '0.04', '0.015748031496063', '', '0');

